import React from 'react';
import '../product/product.css';
import product1 from "../product/Kitchen set/001/kitchenset1.png"


function Product () {
    return (
        <>  
        <div className='container' id='Product'>
            <div className='box'>   
            <p className='kitchenset'></p>
                <img src= {product1} className="model">
                </img>

                <div className='details'>
                    <p>kitchenset</p>
                </div>
            </div>
        </div>
        </>
    )
}

export default Product;
